import React from "react";
import "../css/Common.css";

export function Card({
  header,
  body,
  image,
}: {
  header: string;
  body: string;
  image?: JSX.Element;
}) {
  return (
    <div style={{ margin: 10 }} className="card">
      <div style={{ width: "30%" }}> {image}</div>
      <p className="header-text-card">{header}</p>
      <p>{body}</p>
    </div>
  );
}
